    false,nt"url": null,nt"notes": "The Digital Geologic Map of the Cicero
    Peak quadrangle, South Dakota is composed of GIS data layers, two ancillary GIS
    tables, a Windows Help File with ancillary map text, figures and tables, GIS data
    layer and table FGDC metadata and ArcView 3.X legend (.AVL) files. The data were
    completed as a component of the Geologic Resource Evaluation (GRE) program, a National
    Park Service (NPS) Inventory and Monitoring (I&M) funded program that is administered
    by the NPS Geologic Resources Division (GRD). All GIS and ancillary tables were
    produced as per the NPS GIS-Geology Coverage/Shapefile Data Model (available at:
    http://science.nature.nps.gov/im/inventory/geology/GeologyGISDataModel.cfm). The
    GIS data is available as coverage and table export (.E00) files, and as a shapefile
    (.SHP) and DBASEIV (.DBF) table files. The GIS data projection is NAD83, UTM Zone
    13N. That data is within the area of interest of Wind Cave National Park.",nt"license_title":
